  `datum` datetime NOT NULL,
  `stanje` int(11) DEFAULT NULL,
  `idUsluga` int(11) NOT NULL,
  `cena` decimal(7,2) NOT NULL,
  `naziv` varchar(128) COLLATE utf8_unicode_ci NOT NULL,
  `nazivSalona` varchar(64) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`idTermin`),
  KEY `idOsnovni` (`idOsnovni`),
  KEY `idUsluga` (`idUsluga`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

